				</div>

			</div> <!-- End brush-tools -->

			<!-- Get canvas from WP-shortcode -->
			<div id="doodling-canvas"><canvas id="canvasBottom" width="750" height="1068"></canvas><canvas id="canvasTop" width="750" height="1068"></canvas></div>

			<script>
				/*
		There are two canvases used. The "front" canvas holds the background image.
		The "back" canvas is what the user draws on. This allows the user to erase
		the work that they have done without erasing the outline provided by the image.
	*/

				// Back canvas for the user to draw on
				var canvasBtm = document.getElementById("canvasBottom");
				var ctxB = canvasBtm.getContext("2d");

				// Painting the back canvas white so that it won't be black when it is downloaded
				ctxB.fillStyle = "#ffffff";
				ctxB.fillRect(0, 0, canvasBtm.width, canvasBtm.height);

				// Front canvas with the outline drawing
				var canvasTop = document.getElementById("canvasTop");
				var ctxT = canvasTop.getContext("2d");

				// Mouse actions
				var isMouseDown = false;
				var mouseX = 0;
				var mouseY = 0;

				//Touch actions
				var touchX = 0;
				var touchY = 0;

				// Creating the outline and painting the image on to the top canvas
				var outlineImage = new Image();
				outlineImage.src = document.getElementById("doodleimg").src;

				outlineImage.onload = function() {
					ctxT.drawImage(outlineImage, 0, 0);
				};

				// Setting the default colour, size and shape of the pen
				ctxB.strokeStyle = "#000000"; // drawing black lines.
				ctxB.lineWidth = 1;
				ctxB.lineCap = "round";
				ctxB.lineJoin = "round";

				/* Mouse events */
				// When the user presses their mouse down on the canvas. The user is drawing on
				// the back canvas.
				canvasTop.addEventListener("mousedown", function(evt) {
					isMouseDown = true;

					mouseX = evt.offsetX;
					mouseY = evt.offsetY;

					ctxB.beginPath();
					ctxB.moveTo(mouseX, mouseY);
				});

				// When the user lifts their mouse up anywhere on the screen.
				window.addEventListener("mouseup", function(evt) {
					isMouseDown = false;
				});

				// As the user moves the mouse around on the canvas
				canvasTop.addEventListener("mousemove", function(evt) {
					if (isMouseDown) {
						mouseX = evt.offsetX;
						mouseY = evt.offsetY;

						ctxB.lineTo(mouseX, mouseY);
						ctxB.stroke();
					}
				});

				/* Touch events */
				// As the user touches the canvas
				canvasTop.addEventListener("touchstart", function(evt) {
					if (!evt)
						var evt = event;
					evt.preventDefault(); // Prevents scrolling of the canvas when it's being drawn on

					isMouseDown = true;

					var position = findPos(canvasTop);
					touchX = evt.targetTouches[0].pageX - position[0];
					touchY = evt.targetTouches[0].pageY - position[1];

					ctxB.beginPath();
					ctxB.moveTo(touchX, touchY);
				});

				// As the user draws on the canvas using touch events
				canvasTop.addEventListener("touchmove", function(evt) {
					if (isMouseDown) {
						var position = findPos(canvasTop);
						touchX = evt.targetTouches[0].pageX - position[0];
						touchY = evt.targetTouches[0].pageY - position[1];

						ctxB.lineTo(touchX, touchY);
						ctxB.stroke();
					}
				});

				// As the user no longer touches the screen
				canvasTop.addEventListener("touchend", function(evt) {
					isMouseDown = false;
				});

				// Find the position of an element, working its way up the DOM.
				function findPos(obj) {
					var curleft = curtop = 0;
					if (obj.offsetParent) {
						do {
							curleft += obj.offsetLeft;
							curtop += obj.offsetTop;
						}
						while (obj = obj.offsetParent);
					}
					return [curleft, curtop];
				}

				// swatch interactivity
				var palette = document.getElementById("palette");
				var swatches = palette.children;
				var currentSwatch; // we'll keep track of what swatch is active in this.

				for (var i = 0; i < swatches.length; i++) {
					var swatch = swatches[i];
					if (i === 0) {
						currentSwatch = swatch;
					}

					// when we click on a swatch...
					swatch.addEventListener("click", function(evt) {

						// If the swatch clicked on was already "active", then keep the class
						// Else remove the class from the previously clicked item
						if (this.className === "active") {
							this.className = "active";
						} else {
							this.className = "active"; // give the swatch a class of "active", which will trigger the CSS border.
							currentSwatch.className = ""; // remove the "active" class from the previously selected swatch
							currentSwatch = this; // set this to the current swatch so next time we'll take "active" off of this.
						}

						ctxB.strokeStyle = this.style.backgroundColor; // set the color for the pen.
					});
				}

				// Change the width of the brush according to the slider
				function changeLineWidth(brushSize) {
					ctxB.lineWidth = brushSize;
				}

				// When the Eraser button is clicked. Used to erase previous strokes.
				function erase() {
					currentSwatch.className = ""; // Remove the "active" class from the swatches
					ctxB.strokeStyle = "#ffffff"; // The brush becomes white
				}

				// When the Clear button is clicked. It completely removes all of the user's
				// drawings from the back canvas.
				function clearBtn() {
					ctxB.fillStyle = "#ffffff";
					ctxB.fillRect(0, 0, canvasBtm.width, canvasBtm.height);
				}

				// When the save button is clicked
				var saveBtn = document.getElementById("saveBtn");
				saveBtn.addEventListener("click", function(evt) {
					// Draw the outline on top of the back canvas (and the user's drawings).
					ctxB.drawImage(canvasTop, 0, 0);

					// we'll save using the new HTML5 download attribute to save the image.
					// we'll give the image a name of draw-[timestamp].jpg
					var now = new Date().getTime(); // get today's date in milliseconds.
					var dataUri = canvasBtm.toDataURL("image/jpeg"); // get the back canvas data as a JPG.

					// resolve cross origin security error
					canvasBtm.crossOrigin = "Anonymous";
					// change the a href and download attributes so it'll save.
					this.setAttribute("download", "drawing-" + now + ".jpeg");
					this.setAttribute("href", dataUri);

					window.location.href = dataUri;
					// in older browsers you may need to substitute those last two lines of code with this:
					//window.open(dataUri,"_blank");
					//window.open(dataUri,"");
				});
			</script>

		</div>
		<?php
	}
